package com.cardmonix.cardmonix.domain.entity.account;import jakarta.persistence.*;import lombok.*;@Getter@Setter@AllArgsConstructor@NoArgsConstructor@Table(name = "banks")@Builder@Entitypublic class Banks {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    @Column(name = "bankCode")    private String bankCode;    @Column(name = "bankName")    private String bankName;    public Banks(String bankCode, String bankName){        this.bankCode=bankCode;        this.bankName=bankName;    }}